<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <title>.dequeue()</title>
</head>
<body>
    
    

<h2>.dequeue()</h2>
<p>선택한 요소의 스택에 쌓인 큐를 모두 제거합니다.</p>

<hr>

<h3>.dequeue()</h3>

<h5>정의</h5> 
<p>.dequeue() 메서드 선택한 요소의 스택에 쌓인 큐를 모두 제거합니다.</p>
    

<h5>문법</h5>
<p class="blue">
$("선택자").dequeue();<br>
</p>



   
    
</body>
</html>
